import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Hero.css';

const Hero = () => {
  const navigate = useNavigate();

  const handleGetStarted = () => {
    navigate('/register');
  };

  return (
    <section className="hero-section">
      <div className="container">
        <h1 className="hero-title">Modern Society Management Solution</h1>
        <p className="hero-subtitle">Streamline your residential society operations with our all-in-one management platform</p>
        <div className="hero-buttons">
          <button className="btn btn-custom-primary btn-lg" onClick={handleGetStarted}>
            Get Started
          </button>
        </div>
      </div>
    </section>
  );
};

export default Hero;
